int GetMax(int v, int ll, int rr, int l, int r){
    if(l<ll) l=ll;
    if(r>rr) r=rr;
    if(l>r) return -INF;
    if(ll==l && rr==r) return mmax[v];
    int m=(ll+rr)/2;
    return max(GetMax(2*v,ll,m,l,r),GetMax(2*v+1,m+1,rr,l,r));
}
int GetMin(int v, int ll, int rr, int l, int r){
    if(l<ll) l=ll;
    if(r>rr) r=rr;
    if(l>r) return INF;
    if(ll==l && rr==r) return mmin[v];
    int m=(ll+rr)/2;
    return min(GetMin(2*v,ll,m,l,r),GetMin(2*v+1,m+1,rr,l,r));
}
void Set(int i, int v){
    mmax[MAX+i-1]=v;
    int p=(MAX+i-1)/2;
    while(p!=0){
        mmax[p]=max(mmax[2*p],mmax[2*p+1]);
        p/=2;
    }
    mmin[MAX+i-1]=v;
    p=(MAX+i-1)/2;
    while(p!=0){
        mmin[p]=min(mmin[2*p],mmin[2*p+1]);
        p/=2;
    }

}


